import React from "react";
import "./citytemp.css";

const Citytemp = ({ city, tempu, main }) => {
    return (
        <div id="cont">
            <p id="city">{city}</p>
            {main ? <h1 id="temp">{tempu}°</h1> : null}

            <p id="cloud">صافي</p>
        </div>
    );
};

export default Citytemp;
